void convertTo2D(int *inputArray, int numRows, int numCols) {

    int outputArray[numRows][numCols];

    for (int i = 0; i < numRows; i++) {
        for (int j = 0; j < numCols; j++) {
            outputArray[i][j] = inputArray[i * numCols + j];
        }
    }
    printf("(");
    for (int i = 0; i < numRows; i++) {
        printf("{");
        for (int j = 0; j < numCols; j++) {
            printf("0x%x, ",outputArray[i][j]);
            //if (j !=(numCols - 1))
            //    printf(",");
        }
        printf("},\n");
    }
    printf(")");
}

int** convertTo2DArray(int *inputArray, int numRows, int numCols)
{
      int** newArray =  (int **)malloc(sizeof(int*) * numCols);
      for (int row = 0; row < numRows; row++)
      {
            int* newRow =  (int *)malloc(sizeof(int) * numCols);
            for (int col = 0; col < numCols; col++)
            {
                  newRow[col] = *inputArray;
                  inputArray++;
            }
      newArray[row] = newRow;
      }
      return newArray;
}

void print2DArray(int** arr, int rows, int cols) {
    for (int i = 0; i < rows; i++) {
        for (int j = 0; j < cols; j++) {
            printf("%x ", arr[i][j]);
        }
        printf("\n");
    }
}


